import React from "react";
import projectData from "./projectdata";
import Project from "./Project";

function createProject(props) {
	return (
		<Project
			key={props.id}
			name={props.title}
			img={props.img}
			info={props.info}
			imgalt={props.imgalt}
			// img={contact.imgURL}
			// tel={contact.phone}
			// email={contact.email}
		/>
	);
}

const Projects = (props) => {
	return (
		<div>
			<h1>Projects</h1>
			{projectData.map(createProject)}
		</div>
	);
};

export default Projects;
